rice bought at: ₹309]_______________________________________________________________________________________Long review:I used to wrap long charging cables around the handle bar so that it won\'t come in the way while turning. After being fed up of wrapping cables to handlebars'),('B06XGWRKYT','AF3WE2A3BJW3ZK2XTUU7GTQ5P2IA','R1HA5IN5GZZEKJ','It\'s ok','asking for money for installation and the most important thing that customer service team have not good manner/behaviour to handle the customer...1 star for them'),('B07232M876','AEGT7WPGXXMSH5J3LZLL6CPJ7QMQ','R1HAZS2PLM3RRQ','Product description says 3 feet it\'s hardly a foot length wire.','reasonable thickness & a sturdy intermediate cable. The whole construction of the cable due it’s cable size & flexibility is almost tangle-free.The associated cable was not exactly thick but can’t be termed as thin or delicate too. It’s not the thickest I’ve seen but then thickest doesn’t always means most durable. Given my application it’s more than just suitable.The overall built & quality of the cable & insulation looks promising enough to last few years. Even if used for other than car charging it looks durable enough to last long.I had further shortlisted mansaa & an amkette cable for the same purpose but they were too long for my requirement.4.) COMPACT MOULDED CONNECTORS:*********************************************************Had an inclination towards moulded connectors to avoid any issues where the connectors break open exposing the terminal PCBs.ACTUAL PRODUCT : There are no complaints regarding the connectors of the actual cable. The connectors are perfectly moulded without any joints or risks of splitting open. The connector casings are further quite compact at terminals to fit in comfortably at scarce spaces.The connector ports are sturdy enough both at USB A & micro B ports. The micro B port pins lock securely onto the charging mobile devices which is quite good.No signs of loose construction.Being Gold-plated is more of a misleading & fancy term(in this case) as most of the metal ports designed today already have a corrosion resistance & nobody is going to use them in saline sea water anyways.5.) AVAILABILITY OF TIES/VELCRO STRAPS :***********************************************************As per my intended use in a car where compactness was of paramount importance'),('B09J2SCVQT','AEWL2PAPDGE7BFE4JQNQGAC2OU5Q','R1HBCLTEUAY2M3','Very good product...','that person was clear the problem within a days.  Happy to purchase the product..'),('B0978V2CP6','AGLWAY4KNHP67SQG4DXGZ5PPEY5Q','R1HBDBX7X0PPVY','Not good range','Disadvantage - the sound and video lag with distance while connecting Bluetooth with headphones.Pairing with headphones difficult (need to wait long)Feels volumes low.'),('B0073QGKAS','AESRBPLU5VWDLZIS34S4MGRGXOHA','R1HBS1IAS9P3EK','Value to buy','Good and easy to use'),('B00SMJPA9C','AHZAEVCLQBC6F6VVPI3OWSWZKGMQ','R1HBTSY0F2IO9D','Always worst package','and sole is also too thin'),('B07YZG8PPY','AFYPWMPR6XXQPAOLMGPWOW6HULQA','R1HC3ZLVI3VC2L','Very good product','https://m.media-amazon.com/images/I/61T7yiKCRXL._SY88.jpg'),('B09GFWJDY1','AHY6XDQNLICAHSOUPBE47XD3UDTA','R1HCEZCBOONRT6','Little bit compromise with make & connectivity','Purchased this product for it was available for immediate delivery. The product appears cheap'),('B07F1T31ZZ','AGOHEKMCFFEVVEYK75KRR6JUN5LA','R1HD4L4O8FYBVJ','Meets expectation','An easy-to-use coffee filter at a reasonable price.'),('B098NS6PVG','AHWVEHR5DYLVFTO2KF3IZATFQSWQ','R1HDNOG6TO2CCA','its good','Product quality is good'),('B078XFKBZL','AFVD6HB7DZDVOBDGJOB5OD5HRJFQ','R1HDU0OEUM7U2H','Works for a short period','but not long use'),('B00LY1FN1K','AETKISIGU4D6AWWNZQMNWVRWOJ4Q','R1HDUYLE83VR3D','Excellent','Excellent'),('B09Y358DZQ','AEP43IVDSJR5UREBLL53W5AJKZTQ','R1HFQQWKU1B7T9','Not as expected','Has only one blade in jar and the jar quality is very bad.'),('B01MF8MB65','AHSUUCCXKIC7DV2MVAXINC3B4GOA','R1HFRZM6ZBIQP8','You can expect