sually.. Used sony skullcandy soundmagic kz.. M not gonna say its better then all of the above but u will be satisfied with the product.. Sound quality is awesome.. Bass is good not like in ear..but still wonderful and enough .. U cant have the effect of an in ear earphones bass quality in a cheap bt.. For that u need to spend at least 10k I think.. It has a passive sound isolation.. Nd its great.. Due to its fit and the foam half of the outer noise gets substacted just by putting it on.. Then the rest go out while the music is on.. Dual mode is good.. But don\'t think anyone would use the normal mode.. Cant use the phone eq on nt headphones thats a down side.. But u can use other third party eq or the eq in Spotify or saavn works.. The headphones itself might feel it could break cos all of it is made of plastic.. But feels like its a good one... And wont break .. The pads are soft it dosent hurt the head or the ear.. Used it for hours.. Been hearing from a lot of review about the sound quality of these.. But believe me most of them r giving the review after using it for the first time.. Headphone guide 101 u need to burn the drivers I mean u need to use the headphones for a couple of days to get its full potential.. And sound quality is very good.. Vocals are easyly separated bass is enough.. Treble is the right amount (the way I like it) sound stage is good due to being a on ear with big dynamic driver.. And u would feel the richness of the sound cos of the brand.. A better headphone is the one which creates good and detailed sound.. Not those who are loud.. So yeah I would recommend this over boat. And one last thing.. Due to it being only a bt headphone and no aux cable is available.. The sound quality deepeneds on the device ur using the Bluetooth quality and the amount of sound out put it can produce.. U can charge it with ur nrml charger if its 5v .. Do not use fast charger.. Been using it for two days now.. Need to burn them drivers more.. And will update on the sound quality.. And yeah the battery back up is really good have used it for almost 4/5 hours still 70% charge left.. It shows in the bt connectivity sec on ur phone.. At the end if ur looking for a headphone with a good premium look a well reputed brand and great sound quality do buy this without a doubt.. This r satisfactory very much.. Go for it.P. S Amazon delivery is really not up to the mark.. Even being a reputed company and all ow and another thing saw some complain about it being manufactured in china mine says manufactured in Malaysia.. Yes its a original one have registered it with harman audio..'),('B09SFRNKSR','AHN7KROB4JXXDRI6ZVYUNQLPABWA','R2NO3GT7CX9TX1','Good','It\'s good product..good for parents having pets'),('B0B65MJ45G','AFQGGBH7UOPRRK6A4FS6UAHBBR6Q','R2NO4JULWOQQ5N','Terrible','After 1-2 months'),('B07NPBG1B4','AGAX7R5GL5K2RGHQSQTDMPYC72PA','R2NO8ASBTPQKQZ','No remote control','Remote is not provided.'),('B095K14P86','AGOPYV5RQIH4BBSVXQVFBZLDVHVQ','R2NOAG9D9PY1MD','Good product','including this particular model'),('B09CTWFV5W','AESL35HFDQN4QCKVN7DNGPTWU5XA','R2NOIFFPNAB8AD','Good Purchase','can\'t do it at one go.Damaged packaging'),('B07ZJND9B9','AHKSXLMJOQHJNI2U6A4FURPV5CYQ','R2NOWT8O685BUW','Love it .. nice product',''),('B0116MIKKC','AEKAQEDPX7S73J5RW2YU5SZKTXGQ','R2NP5Z355ZHRS5','Nice!','Helpful for charging multiple devices at a time.'),('B07XCM6T4N','AGWC4Q23F4DQ6TOMY2OBPZUB3W3A','R2NPEFE8O89X67','Average to good','Stability should have been better.'),('B08XXF5V6G','AFRR3XZWCZR62FMNGFE563EFHFUA','R2NQHRYM47YRYK','Kodak Tv','Kodak tv'),('B07W7Z6DVL','AHBISYTXOMEMKDTXVEKH57D2X3RA','R2NQLS6I62ASDV','Good Handy Bluetooth Speaker','Good Bass and Treble. Good Sound Quality.'),('B09ZVJXN5L','AFUH5D4EYPVUKL6RIODLMEAZDVEA','R2NR09K7JPREX9','Quality Product','1) Best product2) Room gets warm within few mins3) Quality is nice4) Timer option is very useful5) Portable'),('B09Z6WH2N1','AEFNEVSP4WMJVLBSRPH3YKKRSDWA','R2NR5VY4ULMZGZ','Price can be