 be 10 negative review of the product you are seeing and 10 positives for the other products. The page will show you a neutral review. That\'s the game sellers are playing these days - to avoid negative reviews. I have posted a picture of the stove I am referring to in this review.2. WATTAGE: Important because this tells how quickly the water will heat up. This one is 1500W - meaning that you can switch it on ... brush your teeth and find the water is boiled. Great time saving !! My earlier one was 900W and it used to take 10-15 minutes of patient waiting. The gas stove boiled water faster. This one takes about 3-4 mins to heat 2 mugs of coffee3. CABLE LENGTH: Most of these kettle makers skimp on the cable length. I have purchased kettles to find they have only a 2-foot long cable ... and I had to return them. This one has cable length of 22\" (slightly more than one meter) - which is allows a comfortable distance between the kettle and the plug.4.  CONNECTOR:  This one uses a 6A plug - which is most common in India. Be careful because from >1500W onwards'),('B09DDCQFMT','AHOTORDSGF2IWSGTMZVAX56B77IQ','RVSKWY5IP3JQB','Volume button doesn\'t work at all','Value for money.'),('B004IO5BMQ','AEGA5UJCOTFHN4JW6PDCIHQGYTEA','RVSWATRY0CJIV','Reviewing after 8 months of with battery backup review','but too smaller than the regular one!'),('B0BGSV43WY','AF333KSWESUJI6F56KHX6T6PKBIA','RVUE4MKJEQRHT','Restart problem','Automatic Restart problem'),('B0819ZZK5K','AGG3ECGCIKNPZJEVJKMFI24VBSCQ','RVUGXND7SHFW8','but heats up and throttles...','but machines with a decent cpu and an average SSD ought to perform simillarly with usb 3.0 or aboveThe writes though'),('B09474JWN6','AFXT4M4YZCGYWUG22BMXEOB7VUOA','RVV3VEBYM65XS','👍 nice','Like'),('B01IOZUHRS','AHQH5PRVD42NW5O7FLDL2ETIBOXQ','RVVK1C0RQFZYV','Good','Works well'),('B08NW8GHCJ','AGSEMC5UI32EZO6GAW4KKT5OVMOQ','RVVUYDXJQ5FWH','Quality is good','very sturdy'),('B07989VV5K','AHSZCGWJCJJWOQ2FI6TDIDES2WTQ','RVX4OJQUR5ZVE','Average','th