oduct has good as expected. Overall a valuable product in this range.Thank you iBall and Amazon.'),('B084N18QZY','AFEPOALC3FJQEMM2E5SK2EEZFXGQ','RX8T7QUKKQ55A','Well it\'s a great cable you can trust on','if used for data transmission.Any one looking for data transmission better find something else.This item is only good for Charging.'),('B08TGG316Z','AEOKQXQO42VI27RS7S6H6RDJTJWQ','RX9ISCNT5KUMA','Amazing product','JBL 3.1 soundbar and Jio set top box. All is working zakkaass !! Picture quality improved compared to my earlier cable. Now getting Dolby 5.1 with this set up. Thumbs up for this item.'),('B07FL3WRX5','AFDSTWW5X5LM7QSJ7TE2GDJEZHSA','RXAODV2OHBKW4','Compact and powerful but alot of plastic','Firstly I got the cracked jar but the product replaced the very next day. I like the new and compact design of the product'),('B09ZVJXN5L','AFEGTYZ3KEHM3T6Q47CE2F3QDTZA','RXAU989TJMDX6','Easy to use','Like it'),('B098R25TGC','AE5VN6K6A4NJNWVYSEWB62MA3GMA','RXB5KHLQUXONP','[Updated] decent tws for under 1k','[Updated]  Overall you really get what you pay for. They serve the purpose of a decent pair of tws for basic quality calls and music listening. Main problem I noticed was with the pairing and connection strength as they routinely lose signal for no apparent reason. Once or twice I had issue of only one of the buds getting paired and had to reset the other one to get it paired.If you have paired these to one device and try to pair to another one without disconnecting from first it simply doesn\'t work. This is starting to get annoying but maybe I\'ll get used to it. We\'ll see.----------------------------------------------------------This is just day 1 review of these. Got them for Rs 898 on some offer on Amazon. I\'ll post updates later on. Hope this is helpful for anyone interested.Package : The packaging is quite decent for such a low price. Comes with the tws earphones fitted with medium earplugs fitted inside the case. Also included are a very short USB c cable and two additional earplugs - small and large. Package includes some Noise stickers and a pretty good user manual and warranty instruction card.Build : was immediately dissapointed with the plastic case as the lid was rattling and not confidence boosting. Will use it for a while to see if my worries are unfounded. The earphones themselves are rather sturdy feeling in hand. They fit very snuggly into the case and there is no evident feel of them coming lose or rattling within the case.Comfort : This is very subjective and each ear is different. It\'s one of the reaonss I wanted to get a cheap tws to see if I\'m OK with the form factor for long hours. The prefitted medium size earplugs were not comfortable so I switched to the small size ones. And after about 20 mins I forgot I was even wearing them. The earbuds are very lightweight owing to the plastic build but upside is that they don\'t cause any strain even after an hour of continuous use. One thing to note is that if you have \"Gandhi\" ears then the fit might be a little awkward - I should know. My ears covered the touch areas of the buds so I had to fiddle around a bit if I wanted to do any of the touch actions. YMMV.Sound quality : I liked them. I\'m no audiophile but they have decent volume and satisfactory levels of bass and separation. I tried my usual test at https://youtu.be/J0a2Prc_MQo and they fared quite well. The treble maxes out at 15khz post which you hear nothing at all but this is to be expected at the price point. There was noticeable vibrations creeping in at below 30hz but the L and R drivers seem to be matched well and all of the panning tests were quite decent. I feel this definitely punches above its price point.Call quality : In a low to no outside noise environment the microphones were very good. There was no lag and the person on the other side said my voice was very clear. But things take a steep fall as soon as little noise is present and you start sounding like you\'re inside a well. Seems the mics can\'t figure out how to filter out your voice so they end up trashing the call quality. Overall you get what you pay for here.Range : max I got was around 5m. Not sure how they tested and got 10m as advertised. Any disruptions like a wall will simply break the connection but they connected back automatically every time so far so I guess that\'s passable.Pairing :------ UPDATE on 12th Aug 2022  - - - - - -Major issue here is that if already paired to a device like a laptop they simply are unable to be paired to another device like your phone. You have to unpair from the first device and then try to pair again. Had issues like only one of the buds pairing as well.Have to fiddle around to get it to work and is not convenient.---------------I don\'t have a phone to test the fast pair features - Actually I\'m not even sure these support it. Anyway'),('B07JB2Y4SR','AFSSI6KQRVUBQ6DTUNIXZ4PJ4Z2A','RXCA5L1FET3BK','Amajin!','but the cap isn\'t tight enough'),('B0BFWGBX61','AE4YGDAAZX7ZDDGP4BTONW72CMIA','RXCDPPX5ZV2WX','Strong buid','Cable is absolutely good looking'),('B07JB2Y4SR','AEZGVKB6YZLTQQTT356NGQIXBMCA','RXCSU83UL85LG','Nice','All good just the little messed up'),('B0BBWJFK5C','AEX23SMNPHAF7B7TZFQDWKF5ONEA','RXDVRYTKOH8TS','Good Multipurpose Product.','but later I contacted the customer care and found out that I received an updated version and it doesn\'t need reset button.'),('B08PSQRW2T','AH5Q2T67DWA5P5DG3FGMWEZ2ES3Q','RXEJH230ZKTRM','Superb Build Quality','Very good worth the money'),('B0141EZMAI','AGPK7U5SHXBYBXEWBTRCIAZSB6LQ','RXF3HCCBWV0VB','Veri good','Overall very good item'),('B0B467CCB9','AE3CEODJYJIUKTIQXGNWKTY5OH2A','RXG29ZHDAZJ1Q','Karbonn',''),('B07XJWTYM2','AFOTA6QJ5UKQOBJ5APZRDK3GVOBQ','RXGEG3BUDZOW0','Good','and the plastic earbuds themselves. We quite liked the yellow-and-black colour scheme of our review unit. The design is simple and the build quality is decent. The device is light at just 30g'),('B09FFK1PQG','AEYCQ3TR2DE6XHPGHBNF5EW